from bs4 import BeautifulSoupfrom requests import getdef parse_car(name: str):    response = get(f"https://www.olx.uz/oz/list/q-{name}/?search%5Border%5D=created_at:desc")    soup = BeautifulSoup(response.text, 'html.parser')    element1 = soup.find_all('div', class_='css-l9drzq')    res = []    for i in element1[:8]:        res_link = i.find('a', class_='css-qo0cxu')        if res_link:            res.append(res_link['href'])    ls = []    for i in res:            link = f"https://www.olx.uz{i}"            print(link)            soup1 = BeautifulSoup(get(link).text, 'html.parser')            div_element = soup1.find('div', class_='css-1wws9er')            print(f"Created -- {soup1.find('span', class_='css-19yf5ek').text} ---------")            print(f"Model -- {soup1.find('h4', class_='css-1kc83jo').text} ---------")            print(f"Price -- {soup1.find('h3', class_='css-90xrc0').text} ---------")  # css-1povu0j            if div_element:                li_elements = div_element.find_all('li')                for li in li_elements:                    ls.append(li.text)            print(ls, '\n\n')print(parse_car('cobalt'))